import React from "react";

const Search = () => {
  return (
    <div className="flex justify-center mt-8">
      <div className="flex items-center bg-white rounded-full border border-gray-300 p-2">
        <input
          style={{ width: "20rem" }}
          type="search"
          placeholder="Search for something..."
          className="pl-5 h-10 text-sm text-gray-900 rounded-full focus:ring-blue-500 focus:border-blue-500"
        />
        <button
          type="submit"
          className="text-white bg-blue-700 hover:bg-blue-800 focus:ring-4 focus:outline-none focus:ring-blue-300 font-medium rounded-full text-sm px-4 h-10"
        >
          Search
        </button>
      </div>
    </div>
  );
};

export default Search;
